import React, {useState,useEffect} from 'react'

export const Imagebox = (props) => {
    const [imgSrc, setImgSrc] = useState();

    useEffect(()=>{
        props.client.onmessage = (message) => {
            setImgSrc(message.data)
        };
    },[])
    return (
        <div>
            {imgSrc && (
          <img
            src={imgSrc}
          />
        )}
        </div>
    )
}
